import { Component } from "react";

export const Feedback = () => {
  return (
    <>
      <h2>Please leave feedback</h2>
      <ul>
        <li>
          <button>Good</button>
        </li>
        <li>
          <button>Neutral</button>
        </li>
        <li>
          <button>Bad</button>
        </li>
      </ul>
    </>
  );
};
